import react, {Component} from 'react';

class ExpandableList extends Component{

  componentDidMount(){
    console.log('value of this.props.listItems: ', 
      this.props.listItems);
  }

  render(){
    return(
      <div
        style={{
          marginTop: '0vh', 
          background: 'black', 
          color: 'white'
        }}
      >
        {
          this.props.listItems.map(element => (
            <div>
              {element}
            </div>
          ))
        }
      </div>
    )
  }
}

export default ExpandableList;
